function openTabPage(n, t) {
    for (var r, u = document.getElementsByClassName("tabcontent"), i = 0; i < u.length; i++)u[i].style.display = "none"; for (r = document.getElementsByClassName("tablinks"), i = 0; i < r.length; i++)r[i].className = r[i].className.replace(" active", ""); document.getElementById(t).style.display = "block"; n.currentTarget.className += " active"
}
const selectRadios = document.getElementsByName("select")
selectRadios.forEach(radio => {
    radio.addEventListener("change", (e) => {
        openTabPage(e, e.target.value)
    })
})
document.getElementById("defaultTabPage").dispatchEvent(new Event('change'));